}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">    <path d="M19,5V0H0V19H5v5H24V5ZM1,18V1H18V5H5V18Zm22,5H6V6H23Z" class="aw-theme-iconOutline" fill="#464646"/>    <polygon points="14 20 15 20 15 15 20 15 20 14 15 14 15 9 14 9 14 14 9 14 9 15 14 15 14 20" class="aw-theme-iconOutline" fill="#464646"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
